import OverviewTable from './OverviewTable';
import { connect } from 'react-redux';

const mapStateToProps = (state) => {
    let props = {
        mostCommonData: [],
        leastCommonData: [],
        frequentlyEscalatedData: [],
        notRecognizedData: []
    }

    if (state.statsLoaded) {
        Object.keys(state.stats.intentCounts).forEach(key => {
            maxTopicCount = Math.max(state.stats.intentCounts[key], maxTopicCount)
            intentsArr.push({ "label": key, "count": state.stats.intentCounts[key] })
        })

        props["maxTopicCount"] = maxTopicCount

        intentsArr.sort((a, b) => parseFloat(b.count) - parseFloat(a.count));
        let mostCommon = intentsArr.slice(0, 10)

        intentsArr.sort((a, b) => parseFloat(a.count) - parseFloat(b.count));
        let leastCommon = intentsArr.slice(0, 10)

        props.mostCommonData = mostCommon
        props.leastCommonData = leastCommon
        props.frequentlyEscalatedData = []
        props.notRecognizedData = [
            {label: "I need to pay my bill" },
            {label: "Where can I get my account information?" },
            {label: "I need to transfer money to my family in Russia." },
            {label: "I was charged $7000 by my energy company"},
            {label: "Wow so cool haha"},
            {label: "Can I defer a payment I have to pay."},
            {label: "Can you please tell me a joke?"}
        ]
    }
}

export default connect(mapStateToProps)(OverviewTable)
